import React from "react";
import {Link} from 'react-router-dom';
import './stylenek.css';


const Cards = ({data}) => {
    return ( 
       <>
       {data.map((card, index) => (
           <Card key={index} className="card">
               <h4>{card.name}</h4>
               <p>@{card.username}</p>
               <a href="#">{card.website}</a>
               <Link to={`/cards/${card.username}`}>More Details</Link>
           </Card>
       ))}
       </>
    );
}

export default Card;
